skyboxShader = Shader(
[[
out vec3 vPos;
void main() {
  vPos = position;
  gl_Position = projectionMatrix * mat4(mat3(viewMatrix)) * vec4(position, 1.0);
  gl_Position = gl_Position.xyww;
}
]],
[[
in vec3 vPos;
uniform samplerCube environmentMap;
void main() {
  vec3 color = texture(environmentMap, vPos).rgb;
  color = color / (color + vec3(1.0));
  gl_FragColor = sRGB(vec4(color, 1.0));
}
]]
)
skyboxShader:uniformInt("environmentMap", 0)
skyboxShader:setCullFace(false)

meshShader = Shader(
[[
out vec3 vNormal;
out vec3 vPosition;
void main() {
  vec4 pos = modelMatrix * vec4(position, 1.0);
  vNormal = normalMatrix * normal;
  vPosition = pos.xyz;
  gl_Position = projectionMatrix * viewMatrix * pos;
}
]],
[[
in vec3 vNormal;
in vec3 vPosition;
uniform vec3 albedo;
uniform float metalness;
uniform float roughness;

const float MAX_REFLECTION_LOD = 4.0;
uniform samplerCube irradianceMap;
uniform samplerCube prefilteredMap;
uniform sampler2D lutMap;
vec3 fresnelSchlickRoughness(in float cosTheta, in vec3 F0, in float roughness) {
  return F0 + (max(vec3(1.0 - roughness), F0) - F0) * pow(clamp(1.0 - cosTheta, 0.0, 1.0), 5.0);
}
vec3 IBL(
  in vec3 albedo, in vec3 normal, in vec3 position,
  in float metalness, in float roughness
) {
  vec3 N = normal;
  vec3 V = normalize(viewPosition - position);
  vec3 R = reflect(-V, N);

  vec3 F0 = vec3(0.04);
  F0 = mix(F0, albedo, metalness);

  vec3 F = fresnelSchlickRoughness(max(dot(N, V), 0.0), F0, roughness);

  vec3 kS = F;
  vec3 kD = 1.0 - kS;
  kD *= 1.0 - metalness;

  vec3 irradiance = texture(irradianceMap, N).rgb;
  vec3 diffuse    = irradiance * albedo;
  vec3 prefilteredColor = textureLod(prefilteredMap, R, roughness * MAX_REFLECTION_LOD).rgb;    
  vec2 brdf = texture(lutMap, vec2(max(dot(N, V), 0.0), roughness)).rg;
  vec3 specular = prefilteredColor * (F * brdf.x + brdf.y);
  vec3 ambient = kD * diffuse + specular;

  return ambient;
}

void main() {
  vec3 color = IBL(
    albedo, vNormal, vPosition,
    metalness, roughness
  );
  color = color / (color + vec3(1.0));
  gl_FragColor = sRGB(vec4(color, 1.0));
}
]]
)
meshShader:uniformInt("irradianceMap", 1)
meshShader:uniformInt("prefilteredMap", 2)
meshShader:uniformInt("lutMap", 3)

skybox = Mesh("box", skyboxShader)

box = Mesh("box", meshShader)
box:setPosition(-2, 0, 0)
box:setScale(0.75, 0.75, 0.75)
box:uniformVec3("albedo", 0.6, 0.6, 0.1)
box:uniformFloat("metalness", 0.0)
box:uniformFloat("roughness", 0.8)
sphere = Mesh("sphere", meshShader)
sphere:setPosition(2, 0, 0)
sphere:uniformVec3("albedo", 0.3, 0.4, 0.7)
sphere:uniformFloat("metalness", 0.0)
sphere:uniformFloat("roughness", 0.1)

environment = Environment("https://cdn.glitch.global/f95f83f8-1295-420a-ba25-3773d1099c3a/wrestling_gym_2k.hdr")

controls = OrbitControls:new({
  phi = math.rad(60),
  radius = 6,
});

framebuffer = Framebuffer(1, true, 8)

log([[
## #010 IBL
Press *CTRL+E* to edit source
]])

function loop()
  if not controls.dragging then
    controls.theta = controls.theta + delta * 0.2
  end
  controls:update()

  framebuffer:bind(resolution.x, resolution.y)
  framebuffer:clear()
  environment:bindCubemap(0)
  environment:bindIrradiance(1)
