class ProjectContestCreate(generics.CreateAPIView):
    queryset = ContestApprovement.objects.all()
    serializer_class = ContestApprovementCreateSerializer
    permission_classes = [IsModerated]

    def post(self, request):
        project = request.data['project']

        contenst_app = queryset.filter(project__id=project)
        project_member = ProjectMember.objects.filter(project__id=project, status=5)

        if contenst_app:
            return Response(
                data="Вы уже подавали проект на конкурс. Играйте по правилам.",
                status=status.HTTP_400_BAD_REQUEST
            )

        if not contenst_app.project or not project_member:
            return Response(
                data="Вы не создатель или руководитель проекта | Проект не является активным :)",
                status=status.HTTP_403_FORBIDDEN
            )

        if project_member.first().member.user != request.user:
            return Response(
                data="Вы не создатель или руководитель проекта:)",
                status=status.HTTP_403_FORBIDDEN
            )

        request.POST._mutable = True
        request.data['is_approved'] = "0"
        request.POST._mutable = False

        request_data = self.serializer_class(data=request.data),
        request_data.is_valid(raise_exception=True)
        self.perform_create(serializer=request_data)

        return Response(
            data=request_data,
            status=status.HTTP_201_CREATED
        )

