#include <math.h>

int main()
{
    double a, b, c;
    int n;
    scanf("%lf%lf%d", &a, &b, &n);
    c = (b - a) / n;
    
    for (double x = a; x <= b; x += c) {
        printf("%lf | ", x);
        
        if (x <= 5) {
            printf("%lf\n", 4 * fabs(sin(4 * x + 1) + 0.5));
        } else if (x <= 11) {
           printf("%lf\n", pow(x, 2) / 11 + 0.5 * sin(3 * x)); 
        } else {
            printf("%lf\n", pow(x, 2) / (pow(x + 11, 2) + 2 * x + 1)); 
        }
        
    }

    return 0;
}

