        return self

    def test():
        print('A test')

    def test2():
        print('A test2')

    return constructor()


@Class()
def BaseClass2(self):
    def constructor():
        self.test3 = test3

        return self

    def test3():
        print('A test3')

    return constructor()


@Class(BaseClass, BaseClass2)
def user(self, x):
    def constructor():
        self.x = x
        self.print_info = print_info
        self.test = test

        return self

    def print_info(self=self):
        print(f'x = {self.x}')

    def test():
        print('Is override')

    return constructor()


