#include<fstream>
#include<iostream>
using namespace std;

void print(double **a, int m, int n) {
    for (int i = 0; i < m; ++i) {
        for (int j = 0; j < n; ++j) {
            cout << a[i][j] << " ";
        }
        cout << endl;
    }
    cout << endl;
}

void res(double **a, int m, int n, double *res) {
    for (int i = n - 1; i >= 0; i--) {
        double x = a[i][n];
        for(int j = i; j < n-1; j++){
            x -= res[j+1] * a[i][j+1];
        }
        res[i] = x;
    }
}

int counter_rang(double **a, int m, int n) {
    int rang = 0;
    for (int i = 0; i < m; i++) {
        int t = 0;
        int l = 0;
        for (int j = 0; j < n; j++) {
            if (a[i][j] == 0) {
                t++;
            }
            l++;
        }
        if (l != t) {
            rang++;
        }

    }
    return rang;
}

void resh(double **a, int m, int n, int p){
    int g = min(n, m), ll = 0;
    for(int i = 0; i < g; ++i){
        for(ll; ll < n - 1 + p; ++ll){
            bool f = 0;
            for(int j = i; j < m; ++j){
                if(a[j][ll] != 0){
                    double t = a[j][ll];
                    for(int k = 0; k < n; ++k){
                        a[j][k] /= t;
                        double temp = a[i][k];
                        a[i][k] = a[j][k];
                        a[j][k] = temp;
                    }
                    f = 1;
                    break;
                }
            }
            if(f){
                break;
            }
        }
        if(ll == n - 1 + p){
            break;
        }
        else{
            ll++;
        }
        for(int j = i + 1; j < m; ++j){
            double t = a[j][ll-1];
            for(int k = 0; k < n; ++k){
                a[j][k] -= a[i][k]*t;
            }
        }
        print(a, m, n);
    }
}

